import React, { Component } from "react";
import "../Lounge/Lounge.scss";

export default class Lounge extends Component {
  componentDidMount() {
    this.setState({ isLoading: false });
  }
  render() {
    return (
      <div className="lounge">
        <p className="lounge__info">I am Lounge</p>
      </div>
    );
  }
}
